def solution(molar_mass1, molar_mass2, given_mass1, given_mass2, volume, temp) :
    # your code goes here
    a = (given_mass1/molar_mass1)
    b = (given_mass2/molar_mass2)
    c = temp + 273.15
    d = 0.082
    e = volume
    
    f = (a+b)
    g= (d*c)/e
    
    h = f*g 
    
    return  h